     &    Sub667(All4,Ind3,Ind4)*UASfC(All5,3 + Ind3,tH)

        Sub674(All4,All5,Ind3,Ind4) = 
     &   Sub672(Ind3,Ind4)*UASf(All4,3 + Ind4,tH)*
     &     UASfC(All5,Ind3,tH) - 
     &    Sub673(Ind3,Ind4)*UASf(All4,Ind4,tH)*
     &     UASfC(All5,3 + Ind3,tH)

	ENDLOOP(Ind4)
	ENDLOOP(Ind3)
	ENDLOOP(All5)
	ENDLOOP(All4)

	LOOP(All4, 1,6,1)
	LOOP(All5, 1,6,1)
	LOOP(Ind1, 1,3,1)
	LOOP(Ind2, 1,3,1)
	LOOP(Ind3, 1,3,1)
	LOOP(Ind4, 1,3,1)

        Sub68(All4,All5,Ind1,Ind2,Ind3,Ind4) = 
     &   (-(3*cI*(CW*SB*Sub64(All4,All5,Ind1,Ind2)*
     &           Sub67(All4,All5,Ind3,Ind4)*XHiggs(hno,3,uzext1)))+
     &        TB*Sub54(All4,All5,Ind1,Ind2)*
     &       (Sub51(All4,All5,Ind3,Ind4)*XHiggs(hno,1,uzext1) - 
     &         Sub61(All4,All5,Ind3,Ind4)*XHiggs(hno,2,uzext1)))/
     &    (CW*SB*TB)

	ENDLOOP(Ind4)
	ENDLOOP(Ind3)
	ENDLOOP(Ind2)
	ENDLOOP(Ind1)
	ENDLOOP(All5)
	ENDLOOP(All4)

	end

